MATCH (e:Encounter)-[:HAS_PROVIDER]->(p:Provider)-[:HAS_ENCOUNTER]->(e)
WHERE e.code = '710841007'
RETURN DISTINCT p.name;

MATCH (m:Medication {description: 'Warfarin Sodium 5 MG Oral Tablet'})<-[:IS_PRESCRIBED_FOR]-(:Patient)-[:HAS_ENCOUNTER]-
    (e:Encounter)-[:IS_COVERED_BY]->(p:Payer)
RETURN p.name, e.code, SUM(m.payerCoverage) as cost;

MATCH (p:Payer)-[:HAS_COVERED]->(e:Encounter)-[:IS_ORDERED_DURING]->(pro:Procedure)
WHERE p.id = 'd31fccc3-1767-390d-966a-22a5156f4219'
RETURN COUNT(DISTINCT pro);

MATCH (i:ImagingStudy)-[:HAS_ORDERED_DURING]->(e:Encounter)
    WHERE i.id = '7d52afa5-9282-64ef-e08c-c66f1a53e7f2'
    RETURN DISTINCT i.modalityCode;

MATCH (ct:ClaimTransaction)-[:IS_ASSOCIATED_WITH]->(p:Patient)-[:HAS_ENCOUNTER]->(e:Encounter)-[:IS_ORDERED_DURING]->(pro:Procedure)
WHERE id(ct) = '576550eb-d73b-1996-b14a-f68254146bf8'
RETURN DISTINCT pro.code;

MATCH (p:Patient)-[:HAS_ENCOUNTER]->(e:Encounter)-[:IS_RESPONSIBLE_FOR]->(org:Organization)
WHERE org.id = '8e3ca57f-6f74-3d61-9803-ab1424290216'
RETURN DISTINCT p.firstName + ' ' + p.lastName AS PatientName;

MATCH (e:Encounter)-[:HAS_PROVIDER]->(p:Provider)-[:HAS_ENCOUNTER]->(e)
WHERE e.code = '866148006'
RETURN DISTINCT p.name;

MATCH (e:Encounter)-[:HAS_PROVIDER]->(p:Provider)-[:HAS_ENCOUNTER]->(e)
WHERE e.code = 'Colonoscopy'
RETURN DISTINCT p.name;

MATCH (e:Encounter)-[:HAS_PROVIDER]->(p:Provider)-[:HAS_ENCOUNTER]->(e)
WHERE e.code = '430193006'
RETURN DISTINCT p.name;

MATCH (e:Encounter)-[:IS_COVERED_BY]->(p:Payer {name: 'Medicare'})
WHERE NOT (e)-[:IS_COVERED_BY]->(:Payer)
RETURN COUNT(DISTINCT e);

MATCH (p:Patient)-[:HAS_DIAGNOSED]->(a:Allergy)
    WHERE a.code = '419199007'
    RETURN COUNT(DISTINCT p);

MATCH (p:Payer)-[:HAS_COVERED]->(e:Encounter)-[:HAS_PRESCRIBED]->(i:Immunization)
WHERE p.id = '8fa6c185-e44e-3e34-8bd8-39be8694f4ce' AND i.payerCoverage = 0
RETURN COUNT(DISTINCT i);
